import React from 'react';

function GitHub() {
  return (
    <a href="https://github.com/cae07">
      <img
        alt="GitHub do Caê Calçolari"
        height="50"
        width="180"
        src="https://img.shields.io/badge/GitHub-100000?style=for-the-badge&logo=github&logoColor=white"
        target="_blank"
      />
    </a>
  );
}

export default GitHub;
